import React from 'react'
import Header from '../../organisms/Header'
import Loader from '../../atoms/Loader'

const Home: React.FC = () => {
  return (
    <div className="bg-gray-900 text-white min-h-screen">
      <Header />
      <Loader />
    </div>
  )
}

export default Home
